import React from "react";
import Student from "./Student";

const Grid = ({ students, onEdit, onDelete }) => {
  return (
    <div className="student-grid">
      {students.map((student) => (
        <Student
          key={student.id}
          student={student}
          onEdit={onEdit}
          onDelete={onDelete}
        />

      ))}
    </div>
  );
};

export default Grid;
